import React, { Component } from 'react'
import {
    Button,
    Form,
    FormGroup,
    Input,
    Label
  } from 'reactstrap';


class FormR extends Component {
    render() {
        return (
            <div>
    <Form>
  {['radio'].map((type) => (
    <div key={`default-${type}`} className="mb-3">
          <Form.Check
        disabled
        type={type}
        label={`disabled ${type}`}
        id={`disabled-default-${type}`}
      />
    </div>
  ))}
</Form>
            </div>
        )
    }
}

export default FormR
